  true,\n\t\"url\": null,\n\t\"notes\": \"Table summarizes instrument precision assessed
  by collocating the two sample boxes. Precision is quantified as the standard deviation
  of the residuals of an orthogonal least squares regression of concentrations from
  the two sample boxes. This allows for an estimation of gradient precision and ultimately
  gradient and flux detection limits.  nnThis dataset is associated with the following
  publication:nRumsey, I. Application of an online ion chromatography-based instrument
  for gradient flux measurements of speciated nitrogen and sulfur.   ENVIRONMENTAL
  SCIENCE &amp; TECHNOLOGY. American Chemical Society, Washington, DC, USA, 9(6):
  2581-2592, (2016).\",\n\t\"owner_org\": \"6d90e48d-3076-4327-b2f4-c33919f374d5\",\n\t\"extras\":
